import { StatusBar } from 'expo-status-bar';
import React, { useState } from 'react';
import { StyleSheet, Text, TextInput, View } from 'react-native';

export default function App() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [email, setEmail] = useState('');

  return (
    <View style={styles.container}>
      <TextInput style={styles.input} placeholder="username" onChange={(e) => setUsername(e)} />
      <TextInput style={styles.input} placeholder="password" onChange={(e) => setPassword(e)} />
      <TextInput style={styles.input} placeholder="email" onChange={(e) => setEmail(e)} />
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#222',
    alignItems: 'center',
    justifyContent: 'center',
  },
  input: {
    width: '60%',
    height: '45px'
  },
});
